import './App.css';
import Posts from './Components/Posts';
import Header from './Components/Header';
import { Route, Routes } from "react-router-dom";
import Layout from './Layout';

function App() {
  return (
      <Routes>
        <Route path='/' element={<Layout/>}/>
        <Route index element={
          <Posts />
        }/>
        <Route path={'/login'} element={
          <div>login page</div>
        }/>
      </Routes>
  );
}

export default App;
